import React from "react";
import styled from "styled-components";

export const TopArrow = () => {
  const Wrap = styled.div`
    width: 160px;
    height: 160px;
    background-color: yellow;
    position: absolute;
    top: 0;
    z-index: 99;
  `;
  return <Wrap>⬆️</Wrap>;
};
